import { atom } from 'recoil';

export const navigationAtom = atom({
  key: 'navigationAtom',
  default: {
    index: 0,
    account: {
      id: 'Robson Zika',
      name: 'Robson Cezario',
      bankMoney: 7000,
      money: 500
    },
    creditCards: [
      {
        number: 7242,
        securityCode: 252,
        expirationDate: +(new Date())
      }
    ]
  } 
});
